CREATE TABLE "universities" 
(
    "college"	VARCHAR(100),
    "state_code"	VARCHAR(25),
    "state_name"	VARCHAR(25),
    "region"	VARCHAR(20),
    "division"	VARCHAR(20),
    "public_or_private"	VARCHAR(512),
    "percentage_applications_received"	DOUBLE PRECISION,
    "percentage_applications_accepted"	DOUBLE PRECISION,
    "number_new_students_enrolled"	DOUBLE PRECISION,
    "percentage_new_students_from_top_10"	DOUBLE PRECISION,
    "percentage_new_students_from_top_25"	DOUBLE PRECISION,
    "number_ft_undergrad"	DOUBLE PRECISION,
    "number_pt_undergrad"	DOUBLE PRECISION,
    "in_state_tuition"	DOUBLE PRECISION,
    "out_of_state_tuition"	DOUBLE PRECISION,
    "room"	DOUBLE PRECISION,
    "board"	DOUBLE PRECISION,
    "additional_fees"	DOUBLE PRECISION,
    "estimated_book_costs"	DOUBLE PRECISION,
    "estimated_personal_spending"	DOUBLE PRECISION,
    "percentage_faculty_with_phd"	DOUBLE PRECISION,
    "student_faculty_ratio"  DOUBLE PRECISION,
    "graduation_rate"	DOUBLE PRECISION
);

